package com.fashion.binge.fashiondesign.models;import java.util.List;/** * Created by gokarna on 20/06/16. */public class OrderDetailItemModel {    private String productName;    private List<String> size;    private List<String> color;    private String quantity;    private String price;    public String getProductName() {        return productName;    }    public void setProductName(String productName) {        this.productName = productName;    }    public List<String> getSize() {        return size;    }    public void setSize(List<String> size) {        this.size = size;    }    public List<String> getColor() {        return color;    }    public void setColor(List<String> color) {        this.color = color;    }    public String getQuantity() {        return quantity;    }    public void setQuantity(String quantity) {        this.quantity = quantity;    }    public String getPrice() {        return price;    }    public void setPrice(String price) {        this.price = price;    }}